		private readonly ISeminarRepository _seminarRepository = seminarRepository;

		public Dictionary<long, string> GetCertificates(long userId)
		{
			var result = new Dictionary<long, string>();
			var certificateItems = _seminarRepository
				.GetUserHistorics()
				.Where(x => x.UserId.Equals(userId))
				.Where(x => x.FinishedMeetings.Equals(x.TotalMeetings))
				.Where(x => x.PresenceRate >= 50);

			certificateItems.AsParallel().ForAll(userHistory =>
			{
				result.Add(userHistory.SeminarId, GetCertificate(userHistory));
			});
			return result;
		}

		private string GetCertificate(UserHistoric historic)
		{
			QuestPDF.Settings.License = LicenseType.Community;
			var result = Document.Create(container =>
			{
				container.Page(page =>
				{
					page.Size(PageSizes.A4.Landscape());
					page.PageColor(Color.FromHex("#CEC3B2"));
					page.MarginTop(2, Unit.Centimetre);
					page.MarginHorizontal(4, Unit.Centimetre);
					page.MarginBottom(1.5f, Unit.Centimetre);

					page.DefaultTextStyle(font => font.FontColor(Color.FromHex("#3B2C21")).FontFamily(Fonts.TimesNewRoman));

					page.Header()
						.Text("CERTIFICADO")
						.Bold()
						.FontSize(65)
						.AlignCenter();

					page.Content()
						.PaddingVertical(0, Unit.Centimetre)
						.Column(column =>
						{
							column.Spacing(20);
							column.Item()
								.Text("Certificado de Participação")
								.FontSize(32)
								.FontFamily(Fonts.Corbel)
								.FontColor(Color.FromHex("#857360"))
								.AlignCenter();

							column.Item()
								.PaddingTop(1, Unit.Centimetre)
								.Text($"{historic.FirstName} {historic.SureName}")
								.Italic()
								.FontSize(35)
								.AlignCenter();

							column.Item()
								.PaddingHorizontal(2, Unit.Centimetre)
								.Text($@"Esteve presente em {historic.PresenceRate}% de um total de {historic.TotalMeetings} encontros voltados para a exposição e discussão de temas relacionados à obra: {historic.Name}.")
								.FontSize(15)
								.FontFamily(Fonts.Corbel)
								.AlignCenter();

							column.Item()
								.PaddingHorizontal(3, Unit.Centimetre)
								.Text("Os organizadores do Clube do Livro - Fé entre Linhas são gratos pela oportunidade de contribuir com seu fortalecimento espiritual.")
								.FontFamily(Fonts.Corbel)
								.FontColor(Color.FromHex("#857360"))
								.FontSize(10)
								.AlignCenter();
						});

					page.Footer().AlignBottom().AlignCenter().Column(column =>
					{
						column.Item().Row(row =>
						{
							Image image = Image.FromBinaryData(Convert.FromBase64String(LOGO));
							row.AutoItem().PaddingLeft(9.25f, Unit.Centimetre).Width(100).Image(image);
							row.RelativeItem().AlignMiddle().AlignCenter();
						});
					});
				});
			}).GeneratePdf();

			return string.Format("data:application/pdf;base64,{0}", Convert.ToBase64String(result));
		}
	}
}
